// import Grid from "@mui/material/Grid";
import SuiTypography from "components/SuiTypography";
import SuiBox from "components/SuiBox";
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
// import Card from "@mui/material/Card";
import 'bootstrap/dist/css/bootstrap.min.css';
// import { Link } from "react-router-dom";
import ProductCell from "layouts/ecommerce/products/product-page/components/ProductCell";
import DataTable from "examples/Tables/DataTable";
// Images
const blackChair =
    "https://raw.githubusercontent.com/creativetimofficial/public-assets/master/soft-ui-design-system/assets/img/ecommerce/black-chair.jpg";


function Overview() {
    const columns =
    {
        columns: [
            { Header: "Investor Name", accessor: "product" },
            { Header: "Transaction Date", accessor: "bse" },
            { Header: "Trxn Mode", accessor: "pan", align: "center" },
            { Header: "User Id", accessor: "a1" },
            { Header: "Transaction Type", accessor: "a2" },
            { Header: "Folio No", accessor: "a3", align: "center" },
            { Header: "AMC", accessor: "a4", align: "center" },
            { Header: "Scheme Name", accessor: "a5" },
            { Header: "NAV", accessor: "a6" },
            { Header: "	Units", accessor: "a7", align: "center" },
            { Header: "	Transaction Amount", accessor: "a8", align: "center" },
        ],

        rows: [
            {
                product: <ProductCell image={blackChair} name="Anil Kumar Rathi" />,
                bse: "Aug 19, 2022",
                pan: "RTA",
                a1: "A182040",
                a2: "Switch In",
                a3: "1041041263",
                a4: "Aditya Birla Sun Life Mutual Fund",
                a5: "ADITYA BIRLA SUN LIFE REGULAR SAVINGS FUND-GROWTH",
                a6: "51.94",
                a7: "962.529",
                a8: "49,998",
            },
        ],

    }


    return (

        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox my={3}>


                <SuiBox mt={8} mb={2}>
                    <SuiBox mb={1} ml={2}>
                        <SuiTypography variant="h5" fontWeight="medium">
                            Monthly Inflow (Aug 2022)
                        </SuiTypography>
                    </SuiBox>
                    <DataTable
                        table={columns}
                        entriesPerPage={false}
                        showTotalEntries={false}
                        isSorted={false}
                    />
                </SuiBox>
            </SuiBox>
        </DashboardLayout>
    );
}

export default Overview;
